def download_large_file_to_s3(url, s3_bucket='congress-documents', s3_key=''):
    try:
        s3_client = boto3.client('s3',
                                 aws_y_id='',
                                 aws_sey='lGh'
                                 )

        print('@', end='')
        with requests.get(url, stream=True) as response:
            response.raise_for_status()
            s3_client.upload_fileobj(response.raw, s3_bucket, s3_key)
    except Exception as e:
        print(e)

def process(line):
    try:
        url = line.split("|")[1]
        file_name = os.path.basename(url)
        download_large_file_to_s3(url, s3_key=file_name)
    except Exception as e:
        print(e)

def concurrentMap(fn, l_args, workers=20, **kwargs):
    try:
        with ThreadPoolExecutor(max_workers=workers) as ex:
            print("Starting Futures")
            for f in as_completed(ex.submit(fn, arg, **kwargs) for arg in l_args):
                try:
                    yield f.result()
                except Exception as e:
                    print(e)
    except Exception as e:
        print(e)

